  2→import { useRef, useState, useCallback, useEffect } from 'react';
  3→import { useAuth } from '../hooks/useAuth';
  4→import ConsentModal from './ConsentModal';
  5→
  6→export default function Layout() {
  7→  return (
  8→    <div style={{ minHeight: '100vh' }}>
  9→      <PullToRefresh>
 10→        <Outlet />
 11→      </PullToRefresh>
 12→      <BottomNav />
 13→      <ConsentModal />
 14→      <ChatwootWidget />
 15→    </div>
 16→  );
 17→}
