 19→function ChatwootWidget() {
 20→  useEffect(() => {
 21→    const baseUrl = import.meta.env.VITE_CHATWOOT_BASE_URL;
 22→    const token = import.meta.env.VITE_CHATWOOT_TOKEN;
 23→    if (!baseUrl || !token) return;
 24→
 25→    const script = document.createElement('script');
 26→    script.src = `${baseUrl}/packs/js/sdk.js`;
 27→    script.async = true;
 28→    window.chatwootSettings = {
 29→      position: 'right',
 30→      type: 'standard',
 31→      launcherTitle: 'サポート',
 32→    };
 33→    script.onload = () => {
 34→      window.chatwootSDK.run({ websiteToken: token, baseUrl });
 35→      // BottomNav の上にバブル配置 + ブランディング非表示
 36→      const style = document.createElement('style');
 37→      style.textContent = `
 38→        .woot-widget-bubble { bottom: 96px !important; }
 39→        .woot-widget-holder { bottom: 96px !important; }
 40→        .branding--link, .powered-by { display: none !important; }
 41→      `;
 42→      document.head.appendChild(style);
 43→    };
 44→    document.body.appendChild(script);
 45→    return () => { script.remove(); };
 46→  }, []);
 47→
 48→  return null;
 49→}
 50→
 51→function PullToRefresh({ children }) {
 52→  const [pulling, setPulling] = useState(0);   // 0..1 progress
 53→  const [refreshing, setRefreshing] = useState(false);
 54→  const startY = useRef(null);
 55→
 56→  const onTouchStart = useCallback((e) => {
 57→    if (window.scrollY === 0) {
 58→      startY.current = e.touches[0].clientY;
 59→    } else {
 60→      startY.current = null;
 61→    }
 62→  }, []);
 63→
 64→  const onTouchMove = useCallback((e) => {
 65→    if (startY.current === null || refreshing) return;
 66→    const dy = e.touches[0].clientY - startY.current;
 67→    if (dy > 0) {
 68→      setPulling(Math.min(dy / 120, 1));
 69→    }
 70→  }, [refreshing]);
 71→
 72→  const onTouchEnd = useCallback(() => {
 73→    if (pulling >= 1 && !refreshing) {
 74→      setRefreshing(true);
 75→      setPulling(1);
 76→      window.location.reload();
 77→    } else {
 78→      setPulling(0);
 79→    }
 80→    startY.current = null;
 81→  }, [pulling, refreshing]);
 82→
 83→  return (
 84→    <div onTouchStart={onTouchStart} onTouchMove={onTouchMove} onTouchEnd={onTouchEnd}>
 85→      <div style={{
 86→        height: pulling > 0 ? 48 * pulling : 0,
 87→        display: 'flex', alignItems: 'center', justifyContent: 'center',
 88→        overflow: 'hidden', transition: pulling === 0 ? 'height 0.2s' : 'none',
 89→      }}>
 90→        <div style={{
 91→          width: 24, height: 24, borderRadius: '50%',
 92→          border: '2.5px solid var(--aicu-teal)',
 93→          borderTopColor: 'transparent',
 94→          opacity: pulling,
 95→          transform: `rotate(${pulling * 360}deg)`,
 96→          transition: pulling === 0 ? 'opacity 0.2s' : 'none',
 97→          animation: refreshing ? 'ptr-spin 0.6s linear infinite' : 'none',
 98→        }} />
 99→      </div>
100→      {children}
101→      {refreshing && <style>{`@keyframes ptr-spin { to { transform: rotate(360deg); } }`}</style>}
102→    </div>
103→  );
104→}
