- 主なサービス: AI 画像生成の教育コンテンツ、Discord コミュニティ、デジタルコンテンツ販売
- Web サイト: https://aicu.jp（モバイルポータル）、https://ja.aicu.jp（メディア）
- 技術書典やイベントにも出展しています

