# Google Search Grounding Configuration

Based on the documentation, here's the exact JavaScript/TypeScript code for enabling Google Search grounding:

```javascript
const groundingTool = {
  googleSearch: {},
};

const config = {
  tools: [groundingTool],
};

const response = await ai.models.generateContent({
  model: "gemini-3-flash-preview",
  contents: "Who won the euro 2024?",
  config,
});
```

**Tool Configuration Object:**

The key element is an object with a `googleSearch` property set to an empty object: `{ googleSearch: {} }`. This tool is then passed within the `tools` array in the `GenerateContentConfig`.

The documentation notes that "when you enable the `google_search` tool, the model handles the entire workflow of searching, processing, and citing information automatically."

