# Chatwoot setUser Implementation Issue

Based on the GitHub discussion, the problem occurs when calling `setUser()` without proper timing synchronization.

## The Solution

**You need to call `setUser()` after the `chatwoot:ready` event**, not immediately after SDK initialization.

## Corrected Code Example

```javascript
(function (d, t) {
  var BASE_URL = "https://app.chatwoot.com";
  var g = d.createElement(t), s = d.getElementsByTagName(t)[0];
  g.src = BASE_URL + "/packs/js/sdk.js";
  g.defer = true;
  g.async = true;
  s.parentNode.insertBefore(g, s);

  g.onload = function () {
    window.chatwootSDK.run({
      websiteToken: '****',
      baseUrl: BASE_URL
    });

    // Listen for the ready event
    window.addEventListener('chatwoot:ready', function() {
      const hmac = CryptoJS.HmacSHA256(identifier, key);
      const identifierHash = hmac.toString(CryptoJS.enc.Hex);

      window.$chatwoot.setUser(identifier, {
        name: "New user",
        email: "newuser@gmail.com",
        identifier_hash: identifierHash
      });
    });
  }
})(document, "script");
```

## Key Point

The SDK must finish loading completely before user attributes are assignable. Triggering `setUser()` too early prevents the user profile from being properly established.

