## Chatwoot HMAC Identity Validation Setup - Complete Guide

Based on the Chatwoot documentation, here's everything you need for HMAC Identity Validation:

---

### 1. **How to Get the HMAC Token from Chatwoot Dashboard**

Navigate to the dashboard following this path:
- **Inboxes** → **Settings** → **Configuration** → **Identity Validation**
- Copy the token shown there

This token is unique to each web widget/inbox.

---

### 2. **Computing identifier_hash for $chatwoot.setUser()**

The `identifier_hash` is computed using **HMAC-SHA256** with:
- **Message**: The user's unique identifier (e.g., user ID)
- **Secret Key**: The HMAC token from your dashboard

**Formula:**
```
identifier_hash = HMAC-SHA256(identifier, hmac_token).toHex()
```

---

### 3. **Exact JavaScript Code for setUser with HMAC**

Here's the complete implementation:

```javascript
// Step 1: Include CryptoJS library
<script src="https://cdnjs.cloudflare.com/ajax/libs/crypto-js/4.1.1/crypto-js.min.js"></script>

// Step 2: Initialize Chatwoot SDK
(function (d, t) {
  var BASE_URL = "https://app.chatwoot.com";
  var g = d.createElement(t), s = d.getElementsByTagName(t)[0];
  g.src = BASE_URL + "/packs/js/sdk.js";
  g.defer = true;
  g.async = true;
