  const updateData = {
    chatwoot_contact_id: chatwootContactId,
    updated_at: new Date().toISOString(),
  }

  // まずメールアドレスで検索（より確実）
  if (email) {
    const { data, error } = await supabase
      .from("unified_users")
      .update(updateData)
