      .select()
      .single()
    if (!error && data) return data as UnifiedUser
  }

  // フォールバック: identifier (Supabase Auth UID) で検索
  if (identifier) {
    const { data, error } = await supabase
      .from("unified_users")
      .update(updateData)
      .eq("id", identifier)
      .select()
      .single()
